import React, { Component } from 'react';
import Message from './Message';

class Messages extends Component {
  render() {

    return (
      <ul>
        {this.props.messages.map(message=> <Message message={message} actions={this.props.actions}/>)}
      </ul>
    );
  }
};

export default Messages;
